response.about:
Корпускул Вселенной, замкнутый в собственных скобах смысла.

"Стервозная сучка" (с) Джульетта -:D

Факты:
- Даша любит выковыривать и коллекционировать пластмассовые цифирки из сыра;
- Когда Даша ехидно улыбается, она похожа на Афекса Твина;
- Даша не умеет прыгать через скакалочку;
- Зато Даша умеет крутить обруч практически на всех впуклостях и выпуклостях своего тела;
- Даша очень любит сыр с плесенью;
- Ещё больше Даша любит, когда её теребят за щёки;
- Дашу в невероятной степени забавляют улиточьи глазки на тоненьких подставочках;
- Даша любит лепить так, чтобы после творческой эрекции материала вокруг рабочего места было неизмеримо больше, чем собственно в произведении ваяния;
- Дашино словоблудие порой походит на ментальное рукоблудие;
- Даша не садится на диету - Даша постится;
- ...
